import React from "react";

const Home=()=>{
    return (
        <div class="hero" id="home">
            <div class="hero__container">
                <h1 class="hero__heading">Hey, I'm<span> Kyle</span></h1>
                <p class="hero__description">Nice to meet you</p>
            </div>
        </div>
    )
}

export default Home;
